import React, { Component }from 'react';
import { Router, Route, IndexRoute } from 'react-router';
import App from "./App";

class Routes extends Component{
	render() {
		return (
			<Router>
				<Route path="/" component={App}></Route>
			</Router>
		)
	}
} 


export default Routes;
